import React from "react";
import './Topbar.css';
import { Link } from 'react-router-dom';


function Topbar() {
  return(
		<div className="topbar">
			<p className="topbar__number"><i class="fa fa-phone" aria-hidden="true"></i> +91 (934) 166-6667</p>
			<p className="topbar__address"><i class="fa fa-map-marker" aria-hidden="true"></i> 404, 1st floor, 4th A Cross Rd, HRBR Layout 2nd Block, Kalyan Nagar, Bengaluru - 560043</p>
			<ul>
				<li><i class="fa fa-facebook" aria-hidden="true"></i></li>
				<li><i class="fa fa-twitter" aria-hidden="true"></i></li>
				<li><i class="fa fa-instagram" aria-hidden="true"></i></li>
				<li><i class="fa fa-youtube-play" aria-hidden="true"></i></li>
			</ul>
			<div className="social_links">
				<Link
					class='social-icon-link facebook'
					to='/'
					target='_blank'
					aria-label='Facebook'
					>
				<i class='fab fa-facebook-f' /></Link>
			</div>
		</div>
	);
}

export default Topbar;
